import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Switch, Route, useHistory } from 'react-router-dom';
import LandingPage from './components/landingPage';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path='/'>
            {({ match }) => <LandingPage match={match} />}
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
